import React from 'react'
import { Link } from 'react-router-dom'

function Home() {
  const backgroundImageUrl = 'url("/images/fenty.jpg")';

  const containerStyle = {
    backgroundImage: backgroundImageUrl,
  };
  return (
    <div className='flex flex-col justify-center align-center bg-cover bg-position-center bg-no-repeat vh-100' style={containerStyle}>
      <div className="container text-center justify-content-center align-items-center ">

        <div className="row">
          <div className="col-12">
            <h1 className="display-1 text-light">Fenty-Wear</h1>
            <p className="lead text-light">Your Fenty-Centric Wardrobe</p>
            <Link to="/products" className="btn btn-primary btn-lg">Shop Now</Link>
          </div>
          </div>
      </div>
    </div>
  )
}

export default Home
